import plate1 from '../assets/images/Nenaslovljeni dizajn (5) 1.png';
import plate2 from '../assets/images/chicken-6262038_1280 1.png';

const Launch = () => {
    return (
        <section>
            <div className="launch w-full flex flex-wrap relative">
                <div>
                    <img src={plate1} alt="plate" className="w-1/5" />
                </div>
                <div className="flex flex-wrap items-center justify-center w-3/5 launch-central">
                    <h2 className="color-natural font-bold text-[36px] text-center mb-[40px]">Fity se priprema za lansiranje.<br/> Budi među prvim korisnicima aplikacije.</h2>
                    <p className="text-[26px] text-center color-natural">U trenutku lansiranja pristup prvoj verziji aplikacije dobiće <strong>300 korisnika</strong>. Rezerviši svoje mesto i saznaj prvi/a kada aplikacija bude dostupna.</p>
                </div>
                <div>
                    <img src={plate2} alt="plate" className="w-1/5" />
                </div>
            </div>
            <div>
                <h3 className="color-fity-green text-[28px] font-bold text-center">Paketi pretplate</h3>
            </div>
        </section>
    );
};

export default Launch;
